import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';

function Header() {
    return (
        <header className="bg-blue-900 text-white p-4 shadow-md">
            <div className="container mx-auto flex justify-between items-center">
                <div className="flex items-center">
                    {/* Placeholder for a logo if you have one */}
                    <div className="mr-6">
                        <h1 className="text-xl font-bold">Job Hiring Platform</h1>
                    </div>
                </div>
                <nav className="flex items-center">
                    <Link to="/" className="inline-block p-2 hover:text-blue-300 transition-colors duration-300">Home</Link>
                    <Link to="/jobs" className="inline-block p-2 hover:text-blue-300 transition-colors duration-300">Find Jobs</Link>
                    <Link to="/hiring" className="inline-block p-2 hover:text-blue-300 transition-colors duration-300">Post a Job</Link>
                    {/* Sign In and Register Buttons */}
                    <Link to="/login" className="inline-block p-2 ml-4 bg-white text-blue-900 hover:bg-blue-100 transition-colors duration-300 font-semibold rounded">Sign In</Link>
                    <Link to="/signup" className="inline-block p-2 ml-4 bg-blue-500 hover:bg-blue-600 transition-colors duration-300 font-semibold rounded">Register</Link>
                </nav>
            </div>
        </header>
    );
}

export default Header;
